let lines = (elem) => {
  document.querySelectorAll(elem).forEach(item=>{
    item.appendChild(item.querySelector('.lineSt__ch').cloneNode(true))
  })
}

const init = () => {
  lines('.lineSt__list')
}


window.addEventListener('DOMContentLoaded', init)